Az jutott eszembe, hogy a jobb als&oacute; sarokban p&ouml;r&ouml;gtek a high elo meccsek. Szem&eacute;ly szerint im&aacute;dtam ki lesni egyet az első percekben valami szimpatikus hőssel &eacute;s egy unalmas pillanatban hesszelni. Az volna a k&eacute;rd&eacute;s, hogy esetleg valaki v&aacute;llalkozna egy k&eacute;t n&eacute;vvel hogy be dobjam őket bar&aacute;tnak n&eacute;ha egy k&eacute;t meccset spectatelni. Nem meccs inveket fogok k&uuml;ldeni &eacute;s &uuml;zeneteket spamelni :D Legink&aacute;bb a support t&eacute;ma &eacute;rdekel a dologban el lesni p&aacute;r dolgot, tanulgani.
